Updating a nested key value in a MongoDB collection document<p>I have this collection in my MongoDB (Atlas) database, that represents exercise logs for users:</p>
<pre><code>[
  {
    _id: ObjectId(&quot;...&quot;) &lt;--- Exercise ID
    exerciseName: &quot;Bench Press&quot;,
    sets: [
      {
        _id: ObjectId(&quot;...&quot;) &lt;--- Set ID
        weight: 100
        reps: 10
        createdAt: 1614461387587
        notes: &quot;&quot;
      },
      {
        // More set data objects
      }
    ]
  },
  {
    // More exercise data objects
  }
]
</code></pre>
<p>I am creating a functionality in my app that allows users to edit a set, incase they input it incorrectly. Currently, I do this by fetching the user's exercise that the set belongs to with:</p>
<pre><code>const user = checkAuth(context);
let exerciseLog = await Exercise.findOne({
  _id: exerciseId,
  user: user.id,
  &quot;sets._id&quot;: setId,
});
</code></pre>
<p>Which gets the correct exercise log. From there, I thought I could use the .find() function to get the set that needs editing and replace the values with new ones like so:</p>
<pre><code>const set = exerciseLog.sets.find((set) =&gt; set.id === setId);
if (set) {
  const newSet = { ...set, weight, reps, notes };
  const setIndex = exerciseLog.sets.findIndex(
    (set) =&gt; set.id === setId
  );
  exerciseLog.sets.splice(setIndex, 1, newSet);
  await exerciseLog.save();
}
</code></pre>
<p>However, this approach once executed, does replace the values for weight, reps and notes but deletes the createdAt key entirely and changes the set id to a new one. I thought that by using the spread operator, values for the object would be retained except the ones that follow the operator? How can I implement a solution in which I keep the old id and createdAt, while updating the weight, reps and notes values in the database?</p>

