Many To Many with embedded pivot list<p>I am trying to select all users which references a group that references a permission that has &quot;valid&quot; set to true (possibly multiple). To achieve this I am planning to use an aggregation with a lookup.</p>
<pre class="lang-js prettyprint-override"><code>db={
  &quot;users&quot;: [
    {
      &quot;_id&quot;: &quot;1&quot;,
      &quot;groups&quot;: [
        &quot;2&quot;
      ]
    },
    {
      &quot;_id&quot;: &quot;2&quot;,
      &quot;groups&quot;: [
        &quot;1&quot;
      ]
    }
  ],
  &quot;group&quot;: [
    {
      &quot;_id&quot;: &quot;1&quot;,
      &quot;permissions&quot;: [
        &quot;12&quot;,
        &quot;3&quot;
      ]
    },
    {
      &quot;_id&quot;: &quot;2&quot;,
      &quot;permissions&quot;: [
        &quot;3&quot;,
        &quot;2&quot;
      ]
    }
  ],
  &quot;permission&quot;: [
    {
      &quot;_id&quot;: &quot;12&quot;,
      &quot;valid&quot;: true
    },
    {
      &quot;_id&quot;: &quot;3&quot;,
      &quot;valid&quot;: true
    },
    {
      &quot;_id&quot;: &quot;2&quot;,
      &quot;valid&quot;: true
    }
  ]
}
</code></pre>
<p>I can't think of an efficient/simple way to do this.</p>
<p>I have 2 ideas:</p>
<ol>
<li>have a lookup from user to group with a pipeline that does a lookup from group to permission. The problem there is I would need to do a $match to see if the user's group list contains the groups id (which I don't know if its possible)</li>
<li>do a simple lookup from user to group than unwind the joined field and do a second lookup using the joined field from group to permission. Than at the end do a $match to see if any contain &quot;valid&quot; true and group the results back to get the original users. This idea doesnt sound very efficient though. (<a href="https://mongoplayground.net/p/JB9Yb3a65Cn" rel="nofollow noreferrer">https://mongoplayground.net/p/JB9Yb3a65Cn</a>)</li>
</ol>
<p>Any ideas or inputs on this?</p>

