How do I query the database using Mongodb after I set up a Mongoose schema for authentication?<p>I successfully set up authentication for my app, which is a node.js (Express) app. I used Passport-local and I also used a Mongoose schema.</p>
<p>The folder structure is like this:</p>
<pre><code>app
 - app.js
 - config
    - auth.js
    - keys.js
    - passport.js
- models 
    - User.js
- node_modules
- package-lock.json
- package.json
- routes
   - index.js
   - users.js 

</code></pre>
<p>Inside the &quot;models&quot; folder is the User.js file, and it contains this schema:</p>
<pre><code>const mongoose=require(&quot;mongoose&quot;);
const UserSchema = new mongoose.Schema({
 username: {
  type: String, 
  required: true,
  min: 4, 
  max: 255
 },
  email: {
  type: String, 
  required: true,
  min: 6, 
  max: 255
 },
  password: {
  type: String, 
  required: true,
  min: 6, 
  max: 1024
 },
  group: {
  type: Number
 },
  score: {
  type: Number
 },
   date: {
  type: Date, 
  default: Date.now
 }
});

const User = mongoose.model(&quot;User&quot;, UserSchema);

module.exports = User;
</code></pre>
<p>And the app.js (the main file) includes the following code. I am not showing everything by the way. The connection string is in the keys.js file.</p>
<pre><code>const mongoose=require(&quot;mongoose&quot;);
const db = require('./config/keys').mongoURI;
const app = express();

mongoose
  .connect(
    db,
    { useNewUrlParser: true ,useUnifiedTopology: true}
  )
  .then(() =&gt; console.log('MongoDB Connected'))
  .catch(err =&gt; console.log(err));
</code></pre>
<p>For operations that don't require the database, such as opening an .ejs file, using &quot;GET&quot;, there is no problem. I am able to do them.</p>
<p>And I can register and login a user, and that user appears in the Mongodb collection called &quot;users&quot; with the correct fields showing. This collection did not exist before I added users using the registration and login forms in the web app.</p>
<p>Now I want to test CRUD operations using the same collection (&quot;users&quot;) in the database. So I tried this:</p>
<pre><code>app.get(&quot;/leaderboard&quot;, function(req, res) {
      db.collection(&quot;users&quot;)
       .find({}, { projection: { _id: 0, username: 1, score: 1 } })
       .sort({score:-1})
       .limit(1)
       .toArray(function(err, result) {
          if (err)
            res.send({ status: false, msg: &quot;failed to retrieve players&quot; });
            console.log(Array.from(result));
            res.send({ status: true, msg: result });
       })   
});
</code></pre>
<p>Before I added authentication to the api, I was able to get the result of this and all other queries to the database without any problem.</p>
<p>The collection name though was different and I used a different connection script for the database. It was like this below. The MONGO_URI was stored as a string in a dotenv file. I didn't have a Mongoose schema either. I only had the index.js file; no other folders.</p>
<pre><code>// Database Connection Info
const MongoClient = require('mongodb').MongoClient;
 const uri = process.env.MONGO_URI;
let db;


// Connect to the database with uri
(async () =&gt; {
   let client = await MongoClient.connect(
       uri,
       { useNewUrlParser: true, useUnifiedTopology: true }
   );

   db = client.db('name');

   app.listen(PORT, async function() {
       console.log('Listening on Port ${PORT}');
       if (db) {
           console.log('Database is Connected!');
       }
   });
})();
</code></pre>
<p>In the past, I used async functions to get the leaderboard result. It was with a different collection (&quot;myCollection&quot;) but with the same database.</p>
<pre><code>app.get(&quot;/leaderboard&quot;, async function(req, res) {
    try {
      await db.collection(&quot;myCollection&quot;)
       .find({}, { projection: { _id: 0, username: 1, score: 1 } })
       .sort({score:-1})
       .limit(1)
       .toArray(function(err, result) {
          if (err)
            res.send({ status: false, msg: &quot;failed to retrieve players&quot; });
            console.log(Array.from(result));
            res.send({ status: true, msg: result });
       })
    }  catch(err) {console.log(&quot;It failed&quot;)}   
});
</code></pre>
<p>But even though the above worked well before I added authentication and added the Mongoose model, I can't get the leaderboard result to show now. I am getting a &quot;MongoDB connected&quot; message on the console after I enter &quot;node app&quot; in the terminal and I get no error messages. This is before I try getting the leaderboard.</p>
<p>The error message I get on the console after I try and get the leaderboard is:</p>
<pre><code>TypeError: db.collection is not a function
</code></pre>
<p>I have also tried the below script without success:</p>
<pre><code>app.get(&quot;/leaderboard&quot;, function(req, res) {
      User
       .find({}, { projection: { _id: 0, username: 1, score: 1 } })
       .sort({score:-1})
       .limit(1)
       .toArray(function(err, result) {
          if (err)
            res.send({ status: false, msg: &quot;failed to retrieve players&quot; });
            console.log(Array.from(result));
            res.send({ status: true, msg: result });
       })   
});
</code></pre>
<p>I want to use async functions for the database queries but I can't find a script for connecting that works with the new way I am connecting: &quot;mongoose.connect&quot;.</p>
<p>I feel I have to use the &quot;mongoose.connect&quot; way of connecting instead of the &quot;const uri = process.env.MONGO_URI;&quot; way because I am using mongoose schemas for the authentication. And this schema automatically creates the collection of users who register. (I don't have any real users; I am using fake user profiles to test the process.) I am also assuming there is a difference between mongoose and mongodb.</p>
<p>It would be best if I could use the old way as I could use async/await with the scripts. However, the main problem is I am not getting any result at all and only error messages although I was able to do many operations involving the database before I added authentication.</p>

