<p>I have a set of things which look like this:</p>
<pre class="lang-js prettyprint-override"><code>  const teams = [
    {
      id: 'a',
      start: date('2020-04-30-10T17:00:00.000Z'),
      end: date('2020-05-01T05:00:00.000Z'),
      equipment: [
        { id: 'balls', quantity: 2 },
        { id: 'bats', quantity: 4 }
      ]
    },
    {
      id: 'b',
      start: date('2020-04-30-10T20:00:00.000Z'),
      end: date('2020-05-01T08:00:00.000Z'),
      equipment: [
        { id: 'balls', quantity: 2 },
        { id: 'bats', quantity: 4 }
      ]
    }
  ]
</code></pre>
