        facet[key] = [
          {
            $match: {
              start: { $not: { $gt: toDate } },
              end: { $not: { $lt: fromDate } }
            }
          },
          {
            $unwind: '$equipment'
          },
          {
            $group: {
              _id: '$equipment.id',
              quantity: { $sum: '$equipment.quantity' }
            }
          },
        ]
        return facet
      }, {})

    const equipmentTotals = await db
      .collection('teams')
      .aggregate([
        {
          $facet: facet
        }
      ])
      .toArray()
</code></pre>
